import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import mainImage from './main.jpeg';
import Second from './Second.js'

function First() {
  return (
    
      <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-4">
        <div className="relative text-center mb-8">
          <h1 className="text-4xl sm:text-5xl md:text-6xl lg:text-7xl font-bold text-blue-600">
            <span className="">Happy </span>
            <span className="">24th Anniversary</span>
          </h1>
        </div>

        <img
          src={mainImage}
          alt="Anniversary"
          className="rounded-lg shadow *:-lg max-w-full h-auto mb-8"
        />

        <Link to="/another-endpoint">
          <button
            className="items-center justify-center bg-blue-600 text-white py-2 px-6 rounded-full text-xl transition hover:bg-blue-800 fixed bottom-4"
          >
            Let's Start
          </button>
        </Link>
      </div>
  );
}


export default First;
